            imgUrl: images.projImg1,
        },

        {
            title: 'DAJ-T Aviation LTD',
            description: 'Aviation Website',
            imgUrl: images.projImg2,
        },
    ];

  return (
    <section className='project' id='project'>
        <Container>
            <Row>
                <Col>
                    <h2>Projects</h2>
                    <p>These are </p>
                </Col>
            </Row>
        </Container>
    </section>
  )
}
